                  <a class="nav-link active" aria-current="page" href="#">Home</a>
                  <a class="nav-link" href="#">Features</a>
                  <a class="nav-link" href="#">Pricing</a>
                  <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
                </div>
              </div>
         
          {/* <Link to="/Addfeedback" className="menu"> {isHidden && <a className="" type="submit" onClick={() => setIsHidden(false)}>Add Feedback</a>} </Link>
          <a className="" onClick={logout}> Welcome - {localStorage.getItem("fullname") } Logout <i className="fa fa-power-off"></i>  </a> */}
         
      </div>
       </nav>
    
    )
}
export default Reviewheader;
